function() {
  // Get the event name
  var eventName = {{manualName}};
  // Form the dynamic key
  var dynamicKey = 'manual_' + eventName;

  var customDataLayerName = {{Custom_DataLayer}};

var dataLayerObject = (customDataLayerName && window[customDataLayerName] && window[customDataLayerName].length > 0) 
? window[customDataLayerName] 
: window.dataLayer;

if (dataLayerObject) {
    // Search in the data layer for an object that contains the dynamic key
    var eventObject = dataLayerObject.find(function(item) {
      // Check if the object has a property with the name dynamicKey
      return item.hasOwnProperty(dynamicKey);
    });

  // If the object is found and contains the dynamic key
  if (eventObject && eventObject[dynamicKey]) {
    // Return the key from the object with the dynamic key
    var dynamicData = eventObject[dynamicKey];
    var keys = Object.keys(dynamicData);
    if (keys[4]) {
      return keys[4];
    }
  }
}
  // If no object with such key is found, return an empty string
  return undefined;
}

